def size_of_data(data, size)
	data_1 = data[0, size]
	return data_1
end

def percentage(data, prime)
	total = 0.0
	data.each do |datum|
		total += 1
	end
	# print total

	count = 0.0
	data.each do |datum|
		if datum == prime
			count += 1
		end
	end
	return (count/total)*100
end

def total(data, affinity_numbers)
	total = 0.0
	affinity_numbers.each do |affinity_number|
		total += percentage(data, affinity_number)
	end
	return total
end

